Future X-Cops (2009) 
Alternatieve titel: Mei Loi Ging Chaat

Hongkong / Taiwan
Science-Fiction

geregisseerd door Jing Wong
met Andy Lau, Bingbing Fan en Barbie Hsu

Een politie-agent (Andy Lau) uit het jaar 2085 komt per ongeluk aan in het jaar 2010. Hij ontmoet een vrouwelijke agente (Barbie Hsu) en samen vormen ze een team tegen een internationaal misdaad syndicaat.

